import React from "react";
import { BallTriangle } from "react-loader-spinner";

const Loading = () => (
  <div
    style={{
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      height: "100vh",
    }}
  >
    <BallTriangle
      height={100}
      width={100}
      radius={5}
      color="#4fa94d"
      ariaLabel="ball-triangle-loading"
      wrapperStyle={{ background: "transparent" }}
      wrapperClass=""
      visible={true}
    />
  </div>
);

export default Loading;
